import React from 'react';
import './Header.css';
import logo from '../../assets/images/logo.svg'; // Dacă ai un logo SVG

const Header = () => {
  return (
    <header className="header">
      <div className="header__logo">
        <img src="../../assets/images/" alt="SlimMom logo" className="logo__image" />
        <span className="logo__text">
          <span className="logo__slim">Slim</span>
          <span className="logo__mom">Mom</span>
        </span>
      </div>
      <nav className="header__nav">
        <a href="#" className="nav__link">LOG IN</a>
        <span className="nav__separator">|</span>
        <a href="#" className="nav__link">REGISTRATION</a>
      </nav>
    </header>
  );
};

export default Header;
